    H-4 was wrong, and the %'s in  this months's H-2 were wrong.  This has been corrected
    from 15% Federal to 21% Federal.               The 18(a) transfer from the non
    federal account this month: $1,204.31 includes $84.54 from line 21(a)(ii) of the
    20 June 2009 filing and $1,119.77 from line 21(a)(ii) of the 20 July 2009 filing.
    \ I uploaded this report 8/13/2009 & it said bad format, but it appeared to upload.
    \ I called FEC & talked to an analyst named Jody who said the origional on 8/11/09
    and an ammendement appeared to upload but I could not get a confirmation # from
    her or the upload system.  I had to leave town to care for my 95 year old father
    & did not follow up.  Quy Vuong requested that I fix this by 12/30/2009, but my
    father died on that day & I was busy with his care most of Dec.\n"
